        "SE.PRM.TENR.MA": "Adjusted net enrollment is the number of pupils of the school-age group for primary education, enrolled either in primary or secondary education, expressed as a percentage of the total population in that age group.",
        "NY.ADJ.NNTY.KD.ZG": "Adjusted net national income is GNI minus consumption of fixed capital and natural resources depletion.",
