        "SL.UEM.1524.FE.ZS": "Youth unemployment refers to the share of the labor force ages 15-24 without work but available for and seeking employment.",
        "SL.UEM.1524.FE.NE.ZS": "Youth unemployment refers to the share of the labor force ages 15-24 without work but available for and seeking employment. Definitions of labor force and unemployment differ by country.",
