        "SP.UWT.TFRT": "Unmet need for contraception is the percentage of fertile, married women of reproductive age who do not want to become pregnant and are not using contraception.",
        "SP.URB.TOTL": "Urban population refers to people living in urban areas as defined by national statistical offices. It is calculated using World Bank population estimates and urban ratios from the United Nations World Urbanization Prospects. Aggregation of urban and rural population may not add up to total population because of different country coverages.",
        "SP.URB.TOTL.IN.ZS": "Urban population refers to people living in urban areas as defined by national statistical offices. It is calculated using World Bank population estimates and urban ratios from the United Nations World Urbanization Prospects.",
        "SP.URB.GROW": "Urban population refers to people living in urban areas as defined by national statistical offices. It is calculated using World Bank population estimates and urban ratios from the United Nations World Urbanization Prospects.",
        "SI.POV.URGP": "Urban poverty gap at national poverty lines is the urban population's mean shortfall from the poverty lines (counting the nonpoor as having zero shortfall) as a percentage of the poverty lines. This measure reflects the depth of poverty as well as its incidence.",
        "SI.POV.URHC": "Urban poverty headcount ratio is the percentage of the urban population living below the national poverty lines.",
        "DT.DOD.DIMF.CD": "Use of IMF credit denotes members' drawings on the IMF other than amounts drawn against the country's reserve tranche position. Use of IMF credit includes purchases and drawings under Stand-By, Extended, Structural Adjustment, Enhanced Structural Adjustment, and Systemic Transformation Facility Arrangements as well as Trust Fund loans. SDR allocations are also included in this category. Note: Data related to the operations of the IMF are provided by the IMF Treasurers Department. They are converted from special drawing rights into dollars using end-of-period exchange rates for stocks and average-over-the-period exchange rates for flows. Data are in current U.S. dollars.",
        "SH.MLR.NETS.ZS": "Use of insecticide-treated bed nets refers to the percentage of children under age five who slept under an insecticide-treated bednet to prevent malaria.",
        "IC.FRM.OUTG.ZS": "Value lost due to electrical outages is the percentage of sales lost due to power outages.",
        "SN.ITK.VITA.ZS": "Vitamin A supplementation refers to the percentage of children ages 6-59 months old who received at least two doses of vitamin A in the previous year.",
        "SL.EMP.VULN.FE.ZS": "Vulnerable employment is unpaid family workers and own-account workers as a percentage of total employment.",
        "SL.EMP.VULN.MA.ZS": "Vulnerable employment is unpaid family workers and own-account workers as a percentage of total employment.",
        "SL.EMP.VULN.ZS": "Vulnerable employment is unpaid family workers and own-account workers as a percentage of total employment.",
        "SL.EMP.WORK.FE.ZS": "Wage and salaried workers (employees) are those workers who hold the type of jobs defined as \"paid employment jobs,\" where the incumbents hold explicit (written or oral) or implicit employment contracts that give them a basic remuneration that is not directly dependent upon the revenue of the unit for which they work.",
        "SL.EMP.WORK.ZS": "Wage and salaried workers (employees) are those workers who hold the type of jobs defined as \"paid employment jobs,\" where the incumbents hold explicit (written or oral) or implicit employment contracts that give them a basic remuneration that is not directly dependent upon the revenue of the unit for which they work.",
        "SL.EMP.WORK.MA.ZS": "Wage and salaried workers (employees) are those workers who hold the type of jobs defined as \"paid employment jobs,\" where the incumbents hold explicit (written or oral) or implicit employment contracts that give them a basic remuneration that is not directly dependent upon the revenue of the unit for which they work.",
        "SP.DYN.WFRT": "Wanted fertility rate is an estimate of what the total fertility rate would be if all unwanted births were avoided.",
        "ER.GDP.FWTL.M3.KD": "Water productivity is calculated as GDP in constant prices divided by annual total water withdrawal.",
        "FP.WPI.TOTL": "Wholesale price index refers to a mix of agricultural and industrial goods at various stages of production and distribution, including import duties. The Laspeyres formula is generally used.",
        "SG.VAW.REAS.ZS": "Percentage of women ages 15-49 who believe a husband/partner is justified in hitting or beating his wife/partner for any of the following five reasons: argues with him; refuses to have sex; burns the food; goes out without telling him; or when she neglects the children.",
        "SG.VAW.ARGU.ZS": "Percentage of women ages 15-49 who believe a husband/partner is justified in hitting or beating his wife/partner when she argues with him.",
